CREATE DEFINER=`root`@`localhost` PROCEDURE `cari_karyawan` (`dep` INT, `jabatan` INT)  BEGIN

	SELECT id_karyawan,nik,nama_lengkap FROM karyawan 
	INNER JOIN jabatan ON jabatan.`id_jabatan`=karyawan.`id_jabatan` INNER JOIN departemen ON departemen.`id_departemen` = jabatan.`id_departemen` 

	where departemen.id_departemen=dep and jabatan.id_jabatan=jabatan and karyawan.status_karyawan !='5' order by karyawan.nama_lengkap asc ;    END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `total_absen` (`id` INT, `thn` INT, `bln` INT(2) ZEROFILL)  BEGIN
    SELECT COUNT(id_karyawan) AS hitung FROM absen WHERE tanggal_absen LIKE CONCAT(thn,'-',bln,'-','%')  AND id_karyawan=id;
    END$$

